      <p>Your one-stop solution for hostel booking.</p>
      <div className="auth-buttons">
        <div className="user-buttons">
          <h2>User Access</h2>
          <Link to="/login">
            <button className="btn">User Login</button>
          </Link>
          <Link to="/register">
            <button className="btn">User Register</button>
          </Link>
        </div>
        <div className="admin-buttons">
          <h2>Admin Access</h2>
          <Link to="/admin/login">
            <button className="btn admin-btn">Admin Login</button>
          </Link>
          <Link to="/admin/register">
            <button className="btn admin-btn">Admin Register</button>
          </Link>
        </div>
      </div>
    </div>
  );
};

export default Homepage;*/
